import styled from 'styled-components'

const image = require("../public/coding.png")

const HomeContainer = () => {

    return (
        <Container>
            <h1>teste</h1>
            <Image
                src={image}
                alt="Coding image"
                width={500}
                height={500}
            />
        </Container>
    )

}

const Container = styled.div`
    display: flex;
    flex-direction: column;
`

export default HomeContainer
